import React, { useEffect, useState } from 'react'
import DataTable from 'react-data-table-component'
import axios from 'axios'
import DeleteIcon from '@mui/icons-material/Delete';
import VisibilityIcon from '@mui/icons-material/Visibility';
import Box from '@mui/material/Box';
import Modal from '@mui/material/Modal';
import PersonIcon from '@mui/icons-material/Person';
import EditIcon from '@mui/icons-material/Edit';
import Insert_fees from '../form/Insert_fees';
// import "./Staff.css"



const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'background.paper',
  border: '0px solid #000',
  boxShadow: 24,
  p: 4,
};


const Staff_Table = () => {
  const [search, setSearch] = useState("");
  const [c_data, setc_data] = useState([]);
  const [filterdata, setfilter] = useState([]);
  const [show,setshow] = useState(false);
  const [open, setOpen] = React.useState(false);
  const [studid,setsdtudid]=useState("");
  const [data, setData] = useState({
    id:"",
    name: "",
    fatherName:"",
    motherName: "",
  

});

const handleClickOpen = async (id) => {
    setOpen(true);
    const data = await axios.get(`http://192.168.1.8:8070/stud/view/${id}`).then((res) => {
      console.log(res.data.data)
      setData(res.data.data)
    }).catch((err) => {
      console.log(err);
    })
  };
  const handleClose = () => {
    setOpen(false);
  
  };
  
  // -----------------------------datatable
  const getdata = async () => {
    try {
      const res = await axios.get("http://192.168.1.8:8070/fees/viewAll");
    
      setc_data(res.data.data);
      setfilter(res.data.data);
    
      
    }
    catch (error) {
      console.log(error);
    }
  };
const columns =[
  {
    name : "SID",
    selector : (row) => row.SID,
    sort:true
  },
  {
    name : "Fees",
    selector : (row) => row.Fees
  },
  {
    name : "AdminName",
    selector : (row) => row.AdminName
  },
  {
    name : "Date",
    selector : (row) => row.Date
  },
 {
  name:"action",
  cell:(row) => <>
  
  
      <EditIcon ></EditIcon>
      <VisibilityIcon onClick={() => handleClickOpen(row._id)} />
  </>

}
]
useEffect(() => {
  getdata();
}, []);

useEffect(() => {
  const result = c_data.filter(val => {
    return val.Name.toLowerCase().match(search.toLowerCase());

  });

  setfilter(result);
}, [search]);






// delete--------------------------
function deletestaff(_id){
  fetch(`http://192.168.1.8:8070/staff/delete/${_id}`,{
    method:"DELETE"
  }).then((r)=>{
    r.json().then((resp)=>{
      console.log(resp); 
      getdata();
    })
  })
}

// --------------------------------------------
  return (
    <>
     <h1 className=' text-center'>fees Data</h1>
        
        {
          show ?  <Insert_fees /> : ""
        }
         <button onClick={()=>setshow(!show)} className="insert"> { show ? "X":"fees"}</button>
       {
          show ? "": <DataTable
          title="Staff list"
          columns={columns}
          data={filterdata}
          pagination
          fixedHeader
          fixedHeaderScrollHeight='550px'
          selectableRows
          selectableRowsHighlight
          highlightOnHover
          subHeader
          subHeaderAlign="left"
          subHeaderComponent={
            <input
              type="text"
              placeholder='search'
              className='w-25 form-control'
              value={search}
              onChange={(event) => setSearch(event.target.value)} />
          }
        />
       }
       <Modal
        keepMounted
        open={open}
        onClose={handleClose}
        aria-labelledby="keep-mounted-modal-title"
        aria-describedby="keep-mounted-modal-description">
        <Box sx={style}>
        <div className="d-flex">
             <PersonIcon style={{"width":"100%", "height":"100px"}} />
        </div>
          <div className='d-flex view_staff'>
             <h6 >Name:</h6><p>{staffData.Name}</p>
          </div>
          <div className='d-flex view_staff'>
            <h6>Email:</h6><p>{staffData.Email}</p>
          </div>
          <div className='d-flex view_staff'>
          <h6>Degree:</h6><p>{staffData.Degree}</p>
          </div>
          <div className='d-flex view_staff'>
            <h6>Salary:</h6><p>{staffData.Salary}</p>
          </div>
          <div className='d-flex view_staff'>
            <h6>Subject:</h6><p>{staffData.Subject}</p>
          </div>
          
        </Box>
      </Modal>

    </>
  
  
  )
}

export default Staff_Table
